import SearchBar from "../SearchBar/SearchBar";
import styles from "../Nav/Nav.module.css";
import React from "react";
import { NavLink } from "react-router-dom";


function Nav(props) {
    return (
      <nav className={styles.navBar}>
        
        <SearchBar onSearch={props.onSearch} handleRandom={props.handleRandom} characters={props.characters}>
          <NavLink to="/" activeClassName={styles.activeLink}>Home</NavLink>
          <NavLink to="/about" activeClassName={styles.activeLink}>About</NavLink>
        </SearchBar>
      </nav>
    )
  }

export default Nav;
